import React, { Component } from 'react'
import { withStyles } from '@material-ui/core/styles';
import Link from 'next/link';
import { connect } from "react-redux"; 
import PropTypes from 'prop-types';
import Button from '@material-ui/core/Button';
import Avatar from '@material-ui/core/Avatar';
import IconButton from '@material-ui/core/IconButton';

const styles = (theme) =>({

})
export class UserIcon extends Component {
    render() {
        const {classes, user:{ authenticated, credentials:{ imageUrl, userId} } } = this.props;
        return (
            <div>
                {
                    authenticated  ?
                    <Link href='/admin/profile'>
                    <a>
                        <IconButton>
                        <Avatar alt={userId} src={imageUrl} />   
                        </IconButton>
                    </a>
                </Link>:
                <Link href='/signup'>
                    <a>
                    <Button variant="outlined" color="primary">
                        Sign Up
                    </Button>
                    </a>
                </Link>
                }
                
            </div>
        )
    }
}
UserIcon.propTypes = {
    classes: PropTypes.object.isRequired,
  };
  const mapStateToProps = (state) => ({
    user: state.user,
    // UI: state.UI
})
export default connect(mapStateToProps)(withStyles(styles)(UserIcon))
